# Introduction and dataset
st.markdown("""
    # BGG Games Dataset

    Este set de datos contiene informacin acerca de distintos juegos de mesa. Entre sus columnas podemos encontrar informacin como el ao de publicacin de los juegos, las calificaciones de los usuarios de la plataforma BGG y su complejidad entre otros. A continuacin, visualizaremos estos datos con la finalidad de obtener conocimientos acerca de las tendencias en la popularidad de los juegos.
            
    El conjunto de datos incluye los siguientes atributos para cada juego de mesa:

    * ID del Juego de Mesa: Un identificador nico para cada juego de mesa (Nmero).
    * Nombre: El ttulo del juego de mesa (Texto).
    * Ao de Publicacin: El ao en que el juego fue publicado por primera vez (Nmero).
    * Nmero Mnimo de Jugadores: El nmero mnimo de jugadores recomendado para jugar el juego (Nmero).
    * Nmero Mximo de Jugadores: El nmero mximo de jugadores recomendado para jugar el juego (Nmero).
    * Tiempo de Juego: La duracin promedio requerida para jugar el juego, generalmente en minutos (Nmero).
    * Edad Mnima Recomendada: La edad mnima recomendada para los jugadores (Nmero).
    * Nmero de Calificaciones de Usuarios: El nmero total de usuarios que han calificado el juego (Nmero).
    * Calificacin Promedio: La calificacin promedio que el juego ha recibido de los usuarios (Punto Flotante).
    * Rango BGG: La clasificacin del juego en el sitio web BGG a la fecha de la coleccin de datos (Nmero).
    * Complejidad Promedio: Una medida de la complejidad del juego basada en las calificaciones de los usuarios, que a menudo refleja la dificultad del juego (Punto Flotante).
    * Nmero de Propietarios Registrados en BGG: El nmero de usuarios de BGG que han registrado la propiedad del juego (Nmero).
    * Mecnicas: Las diversas mecnicas o sistemas utilizados en el juego (Texto).
    * Dominios: Las categoras o dominios a los que pertenece el juego (Texto).""")


# Dasboard Title
st.title("Board Games Dashboard")

# filter bar
st.sidebar.header('Filters')

# Year slider
min_year =  st.sidebar.slider("Year Published",
                              int(df['Year Published'].min()), 
                              int(df['Year Published'].max()), 
                              (2000, 2020))

# Domains filter
selected_domains = st.sidebar.multiselect(
    'Select Domains', 
    df['Domains'].str.split(', ').explode().unique())

# game mechanics
selected_mechanics = st.sidebar.multiselect(
    'Select Mechanics', 
    df['Mechanics'].str.split(', ').explode().unique())

# setting up filter actions
filtered_df = df[(df['Year Published'] >= min_year[0]) 
                 & (df['Year Published'] <= min_year[1])]

# Convert NaN values in 'Mechanics' to empty strings
filtered_df['Mechanics'] = filtered_df['Mechanics'].fillna('')

# Apply the filter for selected mechanics
if selected_mechanics:
    filtered_df = filtered_df[filtered_df['Mechanics'].apply(lambda x: any(mechanic in x for mechanic in selected_mechanics))]

if selected_domains:
    filtered_df = filtered_df[filtered_df['Domains'].apply(lambda x: any(domain in x for domain in selected_domains))]

# Metrics
st.subheader("Overview")
total_games = len(filtered_df)
avg_rating = filtered_df['Rating Average'].mean()
avg_complexity = filtered_df['Complexity Average'].mean()

st.metric("Total Games", total_games)
st.metric("Average Rating", f"{avg_rating:.2f}")
st.metric("Average Complexity", f"{avg_complexity:.2f}")

# Top 10 Games by User Ratings
st.subheader('Top 10 Games by Number of User Ratings')
top_rated = filtered_df.nlargest(10, 'Users Rated')
fig, ax = plt.subplots()
sns.barplot(x='Users Rated', y='Name', data=top_rated, ax=ax)
st.pyplot(fig)

# Distribution of Games by Min Players
st.subheader('Games by Minimum Recommended Players')
min_players_dist = filtered_df['Min Players'].value_counts()
st.bar_chart(min_players_dist)

# Rating and Complexity Analysis
st.subheader('Average Rating vs. Complexity')
fig = px.scatter(filtered_df, 
                 x='Complexity Average', 
                 y='Rating Average',
                 hover_name='Name', 
                 size='Users Rated',
                 color='Min Players')
st.plotly_chart(fig)

# Top Games by Selected Categories
st.subheader('Top Rated Games in Selected Categories')
top_games = filtered_df.nlargest(10, 'Rating Average')[['Name', 'Rating Average', 'Users Rated']]
st.dataframe(top_games)

# Yearly Trends and Insights
st.subheader('Number of Games Published Over Time')
yearly_counts = filtered_df.groupby('Year Published').size().reset_index(name='Count')
fig = px.line(yearly_counts, x='Year Published', y='Count', title='Games Published Per Year')
st.plotly_chart(fig)

######## columns: D,Name,Year Published,Min Players,Max Players,Play Time,Min Age,Users Rated,Rating Average,BGG Rank,Complexity Average,Owned Users,Mechanics,Domains

st.subheader('Rating Average and Complexity Over Time')
yearly_avg = filtered_df.groupby('Year Published')[['Rating Average', 'Complexity Average']].mean().reset_index()
fig = px.line(yearly_avg, x='Year Published', y=['Rating Average', 'Complexity Average'], title='Average Rating and Complexity Over Time')
st.plotly_chart(fig)

# Detailed View of Selected Game
st.subheader('Detailed View of Selected Game')
game_name = st.selectbox('Select a Game', filtered_df['Name'].unique())
game_details = filtered_df[filtered_df['Name'] == game_name].iloc[0]
st.dataframe(game_details)



